import React from 'react';
import UserCard from './UserCard'; // Проверьте, что вы импортировали UserCard

const UserList = ({ users }) => {
  return (
    <div className="user-list">
      <h2>Список пользователей</h2>
      {users.map((user, index) => (
        <UserCard key={index} user={user} />
      ))}
    </div>
  );
};

const users = [
    {
      name: 'Danial',
      surname: 'Abibulla',
      password: 'password1',
      phonenumber: '871234567',
      avatarUrl: '/img/logo.jpeg',
      group: 'IT2-2114'
    },
    {
      name: 'Batyrkhan',
      surname: 'Rukhanov',
      password: 'password2',
      phonenumber: '88712345678',
      avatarUrl: '/img/logo.jpeg',
      group: 'IT2-2114'
    },
    {
      name: 'Adilbek',
      surname: 'Adilzhan',
      password: 'password3',
      phonenumber: '887123456789',
      avatarUrl: '/img/logo.jpeg',
      group: 'IT2-2114'
    },
    {
      name: 'Batyrkhan',
      surname: 'Otynchiev',
      password: 'password4',
      phonenumber: '88712345689',
      avatarUrl: '/img/logo.jpeg',
      group: 'IT2-2114'
    },
  ];
export default UserList;
